import React from 'react';
import logo from './logo.svg';
import './App.css';

this.state = {
  guitars: [
    {
      name: 'Gibson Les Paul',
      id: 'lespaul'
    },
    {
      name: 'Fender Stratocaster',
      id: 'strat'
    },
    {
      name: 'Fender Telecaster',
      id: 'tele'
    }
  ]
}

function App() {
  return (
    <div className="App">
        {
          this.state.guitars.map(guitars => <h1> { guitars.name } </h1>)
        }
    </div>
  );
}

export default App;
